import React from 'react'
import "./userList.css"
import { DataGrid } from '@material-ui/data-grid';


export default function UserList() {
  const columns = [
  { field: 'id', headerName: 'ID', width: 70 },
  { field: 'firstName', headerName: 'First name', width: 130 },
  { field: 'lastName', headerName: 'Last name', width: 130 },
  {
    field: 'age',
    headerName: 'Age',
    type: 'number',
    width: 90,
  },
  {
    field: 'fullName',
    headerName: 'Full name',
    description: 'This column has a value getter and is not sortable.',
    sortable: false,
    width: 160,
   },
];

const rows = [
  { id: 1, lastName: 'Snow Jon', avater: 'img', age: 35 },
  { id: 2, lastName: 'Lannister Cersei', avater: 'img', age: 42 },
  { id: 3, lastName: 'Lannister Jaime', avater: 'img', age: 45 },
  { id: 4, lastName: 'Stark  Arya', avater: 'img', age: 16 },
  { id: 5, lastName: 'Targaryen Daenerys', avater: 'img', age: null },
  { id: 6, lastName: 'Melisandre', avater: 'img', age: 150 },
  { id: 7, lastName: 'Clifford Ferrara', avater: 'img', age: 44 },
  { id: 8, lastName: 'Frances Rossini', avater: 'img', age: 36 },
  { id: 9, lastName: 'Roxie Harvey', avater: 'img', age: 65 },
];

    return (
        <div className="userList">
          <div style={{ height: 400, width: '100%' }}>
      <DataGrid rows={rows} columns={columns} pageSize={5} checkboxSelection />
    </div> 
        </div>
    )
}
